import api from '../../../../api/implement'
import invest_accountModal from './components/invest_accountModal'
import invest_processModal from './components/invest_processModal'

export default {
  name: 'invest_account',
   components: {
     invest_accountModal,
     invest_processModal
  },
  props: {
    id: String
  },
  data () {
    return {
      layout: {
        'label-col': { span: 6 },
        'wrapper-col': { span: 18 }
      },
      status:{
        loading:true
      },
      form: this.$form.createForm(this),
      changes: {},
      process:{},
      modal1: {
        record: null,
        visible: false,
        type: '1',
        process_id: this.id
      },
       modal2: {
        record: null,
        visible: false,
        type: '1',
        change_id: this.id
      },
      columns1,
      columns2,
      processList:[],
      changeList: []
    }
  },
  mounted () {
    this.getData()
  },
  methods: {

    getData () {
      this.status.loading=true
      api.getInvestProcessList(this.$store.getters.projectSelected.id)
        .then(data => {
          this.processList = data
          this.status.loading=false
        })
      api.getInvestProcess(this.id)
        .then(data => {
          this.process = data
        })
      api.getInvestChangeList(this.$store.getters.projectSelected.id)
        .then(data => {
          this.changeList = data
          this.status.loading=false
        })
      api.getInvestChange(this.id)
        .then(data => {
          this.changes = data
        })
    },
    handleClose1 () {
      this.modal1.type = ''
      this.modal1.record = null
      this.modal1.visible = false
      this.getData()
    },
     handleClose2 () {
      this.modal2.type = ''
      this.modal2.record = null
      this.modal2.visible = false
      this.getData()
    },
    handleCreate1 () {
      this.modal1.type = 'create'
      this.modal1.record = null
      this.modal1.visible = true
    },
    handleCreate2 () {
      this.modal2.type = 'create'
      this.modal2.record = null
      this.modal2.visible = true
    },
    handleEdit1 (record) {
      this.modal1.type = 'edit'
      this.modal1.record = record
      this.modal1.visible = true
    },
     handleEdit2 (record) {
      this.modal2.type = 'edit'
      this.modal2.record = record
      this.modal2.visible = true
    },
    handleDelete1 (record) {
      api.deleteInvestProcess(record.id)
        .then(data => {
          this.$notification.success({ message: '成功', description: '删除成功', key: 'SUCCESS' })
          this.getData()
        })
    },
    handleDelete2 (record) {
      api.deleteInvestChange(record.id)
        .then(data => {
          this.$notification.success({ message: '成功', description: '删除成功', key: 'SUCCESS' })
          this.getData()
        })
    },
    getInDe(record) {
      let change_price = parseFloat(record.change_price)
      let contract_price = parseFloat(record.contract_price)
      if (change_price && contract_price) {
        return `${(change_price-contract_price).toFixed(2)}`
      } else {
        return ''
      }
    },
    getpaidTotal(record) {
       let change_price = parseFloat(record.change_price)
      let contract_price = parseFloat(record.contract_price)
      if (change_price && contract_price) {
        return `${(change_price-contract_price).toFixed(2)}`
      } else {
        return ''
      }
    },
    getRatio(record) {
       let change_price = parseFloat(record.change_price)
      let contract_price = parseFloat(record.contract_price)
      if (change_price && contract_price) {
        return `${(change_price-contract_price).toFixed(2)}`
      } else {
        return ''
      }
    },
    parseFloat (f) {
      return parseFloat(f)
    }
  }
}
